                ABOUT
            </h1>

            <div className="about-body">
                hi, i'm will :)
            </div>

            <div className="about-pic">
                <img src={logo} alt="Will Sather" href="/" width="100" height="100"/>
            </div>

        </div>
    );
  }

  export default About;
